import React, {Component} from 'react';
import './bootstrap.css';
import PDF0 from './form/0.pdf';


function importAll(r) {
    let files = {};
    r.keys().map((item, index) => { files[item.replace('./', '')] = r(item); });
    return files;
}

class Section extends Component{

  render(){
    const doctors = [
      {
        'name' : 'Nathan Sumilang',
        'description' : 'TODO'
      },
      {
        'name' : 'Gwenith Cancino',
        'description' : 'TODO description'
      }
    ];
    const forms = [
      {
        'title' : '14 Month Questionaire',
        'sample' : '0'
      },
      {
        'url' : 'TODO URL',
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      },
      {
        'url' : 'TODO URL',
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      },
      {
        'url' : 'TODO URL',
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      }
    ];
    //TODO : Add images to the slideshow
    const slideImages = [
      {
        'url' : 'TODO URL',
        'alt' : 'Alt Image'
      }
    ];
    return(
      //<AboutUs />
      <section className="container-fluid">
        <Home id="home" images={slideImages} />
        <Doctor id="about" doctor={doctors} />
        <FormPDF id="form" form={forms} />
        <ContactUs id="contact"/>
      </section>
    );
  }
}

const Home = props => {
  const images = props.images.map((image, index) =>{
    return(
      <div>
        <img alt="home image here"/>
      </div>
    );
  });
  return <section id="home" className="row">{images}</section>
};


const Doctor = props =>{
  const doctors = props.doctor.map((doctor, index) =>{
    return(
      <div key={index} className="col-md-6 text-center">
        <div>{doctor.name}</div>
        <div>{doctor.description}</div>
      </div>
    );
  });
  return <section id="doctors" className="row">
        <h1 className="col-md-12 text-center">Meet Our Doctors</h1>
        {doctors}</section>
};

const FormPDF = props =>{
  const pdf = importAll(require.context('./images', false, '/\.png/'));
  const forms = props.form.map((form,index) =>{
    return(
      <div key={index} className="col-md-3 text-center">
        <a href={PDF0}>
          <img src={`/image/form/${form.sample}.png`} alt="Need Image of Form"/>
          <p>{`image at ${form.title}`}</p>
        </a>
      </div>
    )
  });
  return <section id="forms" className="row">
      <h1 className="col-md-12 text-center">Forms</h1>
      {forms}
    </section>
};

const ContactUs = () =>{
  return(
    <section id="contact" className="row">
      <h1 className="col-md-12 text-center">Contact Us</h1>
      <div className="col-md-6 text-center">
        <h5>Email: </h5>
        <h5>Phone Number: </h5>
      </div>
      <div className="col-md-6 text-center">
        <h5>Address: </h5>
        <p>Address Line 1</p>
        <p>City, State Zip</p>
      </div>
    </section>
  );
}

export default Section;
